// src/views/SearchPage.js
import React from 'react';
import Search from '../components/Layout/Search'; // Ruta corregida para el componente Search
import Footer from '../components/Layout/Footer'; // Aseguramos que el Footer esté presente
import Header from '../components/Layout/Header'; // Aseguramos que el Header esté presente

function SearchPage() {
  return (
    <div className="search-page-container">
      <main className="search-page-content">
        <h1>Search for Movies</h1>
        <Search />
      </main>
    </div>
  );
}

export default SearchPage;
